# Normalizar y validar datos
for guia in guias:
    # Convertir 'categoria_id' al ID numérico correspondiente
    if isinstance(guia['categoria_id'], str):
        guia['categoria_id'] = categoria_ids.get(guia['categoria_id'])
        if guia['categoria_id'] is None:
            print(f"La categoría '{guia['categoria_id']}' no es válida. Guía: {guia['titulo']}")
            continue

    try:
        # Buscar o crear la categoría
        categoria = Categoria.objects.get(id=guia['categoria_id'])

        # Crear o actualizar la guía
        guia_obj, created = Guia.objects.update_or_create(
            titulo=guia['titulo'],
            defaults={
                'descripcion': guia['descripcion'],
                'categoria': categoria,
                'manual': guia.get('manual', ''),
                'tipo_servicio': guia.get('tipo_servicio', ''),
                'equipo_marca': guia.get('equipo_marca', ''),
                'equipo_modelo': guia.get('equipo_modelo', ''),
                'fecha_creacion': timezone.now(),
                'puntuacion': round(random.uniform(3.5, 5.0), 2),  # Puntuación aleatoria entre 3.5 y 5
            }
        )

        action = "creada" if created else "actualizada"
        print(f"Guía '{guia_obj.titulo}' {action} correctamente.")

    except Categoria.DoesNotExist:
        print(f"La categoría '{guia['categoria_id']}' no existe en la base de datos. Guía: {guia['titulo']}")
    except Exception as e:
        print(f"Error al procesar la guía '{guia['titulo']}': {e}")

print("Guías de la base de conocimiento procesadas exitosamente.")